import React from "react";
import InvoiceForm from "../components/InvoiceForm";
import InvoiceList from "../components/InvoiceList";

const Home = () => {
  return (
    <div>
      <h2>Invoice Management</h2>
      <InvoiceForm />
      <InvoiceList />
    </div>
  );
};

export default Home;
